import React from 'react';
import './skills.css';


class Skills extends React.Component {
    render() {
        return (
            <React.Fragment>
                <p className="s-title">Skills</p>
                <ul className="s-list">
                    <li></li>
                    <li></li>
                </ul>
            </React.Fragment>
        );
    }
}

export default Skills;
